		"id_str": "1278531166149111810",
		"full_text": "Another really hilarious scene in the movie is when Tom Hanks is like ‚ÄúMeryl Streep, we want to publish it. But there are risks.‚Äù ‚ÄúWhat risks?‚Äù ‚Äúwe could go to prison.‚Äù\n\nAnd, like, the only reasonable response here is ‚Äúwell we aren‚Äôt adding any value, so...pass?‚Äù",
